import './Message.css'


const Message = ({ user, index }) => {
    const topPosition = 10 + index * 60; // Начальное значение + отступ между уведомлениями
    return (
        <div className='notification-popup' style={{ top: `${topPosition}px` }}>
            <div>{user.user_name}</div>
        </div>
    );
};
export default Message;
